import { NavLink } from 'react-router-dom';
import React from 'react';
import './NavBar.css'
import { useState } from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';

function NavBar() {

    function onTabClick(event) {
        console.log(event.target.id)
    }
    
    return ( 
        <div className='navbar'>

            <Tabs>
                <Tab value="banana" header="Banana Header">
                Banana
                </Tab>
                <Tab value="apple" header="Apple Header">
                Apple
                </Tab>
            </Tabs>


                <NavLink to='/'>
                <button id='home' onClick={onTabClick}> <img id='home' src='favicon.ico'/> </button>
                </NavLink>
                <NavLink to='/tab1'>
                <button id='1' onClick={onTabClick}>Movies</button>
                </NavLink>
                <NavLink to='/tab2'>
                <button id='2' onClick={onTabClick}>Events</button>
                </NavLink>
                <NavLink to='/tab3'>
                <button id='3' onClick={onTabClick}>Admin</button>
                </NavLink>
        
        </div>
     );
}

export default NavBar;
